import fs from 'fs';

// Read contents as a string
const template = fs.readFileSync(__dirname + '/appTemplate.html', 'utf8');

export class App {
  /**
   *
   * @param {HTMLElement} _appElement
   */
  constructor(_appElement) {
    this.appElement = _appElement;
  }

  render() {
    this.appElement.appendChild(template);
  }
}
